function getBreakfastDataById(id) {
    switch (id) {
        case 1:
            return {
                name: "cheese",
                colour: "yellow",
                pricePerKg: 10.0,
                imgUrl: "www",
            };
        case 2:
            return {
                name: "cheese2",
                colour: "green",
                pricePerKg: 20.0,
                imgUrl: "www",
            };
        case 3:
            return {
                name: "cheese3",
                colour: "blue",
                pricePerKg: 30.0,
                imgUrl: "www",
            };
        case 4:
            return {
                name: "cheese4",
                colour: "red",
                pricePerKg: 40.1,
                imgUrl: "www",
            };
        case 5:
            return {
                name: "cheese5",
                colour: "turquoise",
                pricePerKg: 50.0,
                imgUrl: "www",
            };
        default:
            return null; // Return null for invalid IDs
    }
}

